        var xShapePositions = [];         // x è½´ä¸å¾å½¢çä½ç½®
        var xShapeWidth = 0;          // x è½´ä¸å¾å½¢å®½åº¦(èªéåº)
        var dvbWidth = this.DVBWidth;            // æ°æ®è§å¾æ¡å®½åº¦

